define('dataFlow/dataFlow_loader',[
        "underscore",
        "dataFlow/core",
        "dataFlow/components/outputComponents",
        "dataFlow/components/number",
        "dataFlow/components/simplemath",
        "dataFlow/components/treeComponents",
        "dataFlow/components/numpy_create",
        "dataFlow/components/numpy_simplemath",
        "dataFlow/components/numpy_basics",
        "dataFlow/components/dataframe_create",
        "dataFlow/components/dataframe_basics",
        "dataFlow/components/string",

    ],function(_,
               core,
               outputComponents,
               number,
               simplemath,
               tree,
               numpy_create,
               numpy_simplemath,
               numpy_basics,
               dataframe_create,
               dataframe_basics,
               string,
    ){
        var dataFlow = {};
        dataFlow = _.extend(dataFlow,core);

        dataFlow["components"] = {};

        // registerModule will add a 'module' property to each component, then make those components available in the named module
        // This is done using _.extend(), so multiple files can become part of the same module without overwriting anything.
        function registerModule(components,moduleName){
            _.each(components,function(val,k){
                // add 'module' property to each component, so they can be sorted nicely in the UI
                val["module"] = moduleName;
            });

            dataFlow["components"][moduleName] = dataFlow["components"][moduleName] || {};
            _.extend(dataFlow["components"][moduleName],components);
            // if (extendsModule){
            //     _.extend(dataFlow["components"][moduleName],components);
            // } else {
            //     dataFlow["components"][moduleName] = components; 
            // }
        }

        registerModule(tree, "tree");
        registerModule(number, "number");
        registerModule(simplemath, "simplemath");
        registerModule(numpy_create, "numpy_create");
        registerModule(outputComponents, "outputComponents");
        registerModule(numpy_simplemath, "numpy_simplemath");
        registerModule(numpy_basics, "numpy_basics");
        registerModule(dataframe_create, "dataframe_create");
        registerModule(dataframe_basics, "dataframe_basics");
        registerModule(string, "string");

        // TODO: Use this ONCE to create an index, then use the index ?
        dataFlow.iterateComponents = function(callbackNameFunction){
            return (function dig(obj){
                var objKeys = _.keys(obj);
                for (var i=0;i < objKeys.length; i++){
                    var k = objKeys[i];
                    if (typeof obj[k] === "function") {
                        callbackNameFunction(k,obj[k]);
                        //console.log(k + " / "+  obj[k]["label"] + " / " + obj[k]["desc"]+ " (" + obj[k]["module"]+" module)");
                    } else {
                        dig(obj[k]);
                    }
                }
            })(dataFlow["components"]);

            // The less-clever (maybe clearer?) async loop strategy
            //_.each(_.keys(dataFlow["components"]),function(group){
            //    _.each(_.keys(dataFlow["components"][group]),function(componentKeyName){
            //        callbackNameFunction(componentKeyName,dataFlow["components"][group][componentKeyName]);
            //    })
            //});
        };

        dataFlow.findComponentConstructorByName = function(name){
            var f = null;
            dataFlow.iterateComponents(function(testName,ComponentConstructor){
                if (name === testName) f = ComponentConstructor;
            });
            return f;
        };

        dataFlow.createComponentByName = function(name,args){
            var constructorFunction = dataFlow.findComponentConstructorByName(name);
            if (_.isNull(constructorFunction)) {
                console.warn("Couldn't find component by name: " + name);
                return null;
            }
            return new constructorFunction(args);
        };

        // Add a "componentName" property to EVERY component. Putting this function here prevents me from
        // repeating code in every component class to give it a name. This could be done inelegantly
        // with named constructor functions, but that screws up the structure of DataFlow's inheritance
        (function(){
            dataFlow.iterateComponents(function(name,func){
                // 'componentName' is used while reading in and writing out JSON representations of the project
                func.prototype.componentName = name;
            });
        })();

        return dataFlow;
    }
);
define('dataFlow/UI/contextMenuJupyter',[
    "jquery",
    "underscore",
    "backbone",
    "dataFlow/dataFlow_loader"
],function($,_,Backbone,DataFlow){

    var contextMenuTemplate = '<div class="context-menu">'+
        '        <ul class="dropdown-menu" role="menu">'+
        '        <li class="comp_Name"><span><%= componentName %></span></li>'+
        '        <li><a tabindex="-1"><input type="text" placeholder="Component Name" value="<%= componentPrettyName %>"/></a></li>'+
        '        <li class="divider"></li>'+
        '            <li><a class="deleteComponent" tabindex="-1"><span class="fa fa-remove icongutter"></span>Delete</a></li>'+
        '            <li><a class="helpTooltip" tabindex="-1"><span class="fa fa-question-circle icongutter"></span>Help: <%= componentName %> </a></li>'+
        '        </ul>'+
        '        </div>';


    // prevent multiple context menus by keeping a "singleton" of sorts:
    var singleContextMenu = null,
        template = _.template(contextMenuTemplate); // precompile once


    var ContextMenu = Backbone.View.extend({
        events: {
            'click input': "keepMenu",
            'contextmenu input': "keepMenu",
            'click a.previewToggle': "togglePreview",
            'click a.deleteComponent': "deleteComponent",
            'keyup input': "editComponentPrettyName"
        },
        template: template,
        initialize: function(opts){
            // Keep track of the one active context menu
            if (!_.isNull(singleContextMenu)) {singleContextMenu.destroy();}
            singleContextMenu = this;

            var x = opts.x,
                y = opts.y;

            // prepare to remove the context menu when necessary
            this.registerCleanup();

            this.render(x,y);
        },
        registerCleanup: function(){
            _.bindAll(this,"destroy");
            this.hideEventHandlers = {click: this.destroy,contextmenu: this.destroy,mousewheel: this.destroy};
            $(document).on(this.hideEventHandlers);
        },
        keepMenu: function(e){
            e.stopPropagation();
        },
        editComponentPrettyName: function(e){
            this.model.set('componentPrettyName',$(e.target).val());
        },
        togglePreview: function(){
            this.model.set('preview',!this.model.get('preview'));
        },
        deleteComponent: function(){
            this.model.destroy();
        },
        exportSVG: function(){
            this.model.exportGeometry("SVG");
        },
        render: function(x,y){
            var html = this.template(this.model.toJSON());
            $('body').append(this.$el);

            this.$el.append($(html)).find('div.context-menu').css({
                display: 'block',
                top: y+'px',
                left: x +'px'
            });
        },
        destroy: function(){
            $(document).off(this.hideEventHandlers);
            this.$el.empty();
            this.remove();
            singleContextMenu = null;
        }
    });

    return ContextMenu;
});

